import React from "react";
import {
  BrowserRouter as Router,
  Route,
  Routes,
  Outlet,
  useNavigate,
} from "react-router-dom";
import "./App.css";
import Home from "./components/Home/Home";
import Projects from "./components/Projects/Projects";
import Contact from "./components/Contact/Contact";
import Navbar from "./components/NavBar/NavBar";
import { CSSTransition } from 'react-transition-group';
import "./AppTransition.css";


function App() {
  return (
    <div className="App">
      <div className="App-bg-effect">
        <Router>
          <div className="App-main">
            <header className="App-header">
              <Navbar />
            </header>
            <Routes>
            <Route 
          path="/" 
          element={
            <CSSTransition 
              in={true} 
              appear={true}
              timeout={500}
              classNames="fade">
              <Home />
            </CSSTransition>
          } 
        />

        <Route
          path="/projects"
          element={
            <CSSTransition 
              in={true}
              appear={true}
              timeout={500}
              classNames="fade">
              <Projects />
            </CSSTransition>
          }
        />
<Route
  path="/contact"
  element={
    <CSSTransition 
      in={true} 
      appear={true}
      timeout={500}
      classNames="fade">
       <Contact />
    </CSSTransition>
  }
/>            </Routes>
          </div>
        </Router>
      </div>
    </div>
  );
}

export default App;
